import { Zakres } from "../../features/features";

export const Porzadek = () => {
  return (
    <div>
      <h2>Utrzymanie porządku</h2>
      <p>
        Zapewniamy kompleksowe usługi utrzymania porządku, które są kluczowe dla
        utrzymania czystości i estetyki w Twoim otoczeniu. Nasz doświadczony
        zespół specjalistów oferuje szeroki zakres usług porządkowych, aby
        zapewnić, że Twoje otoczenie będzie zawsze czyste, schludne i przyjemne
        dla mieszkańców czy użytkowników. Niezależnie od tego, czy potrzebujesz
        usług porządkowych dla swojego domu, firmy czy terenów publicznych,
        możesz polegać na naszej profesjonalnej obsłudze. Dzięki naszym usługom
        utrzymania porządku, możesz cieszyć się czystym i schludnym otoczeniem,
        bez konieczności poświęcania czasu i wysiłku na własnoręczne sprzątanie.
        Pozwól nam zadbać o porządek, a Ty skup się na innych ważnych sprawach.
      </p>
      <Zakres />
    </div>
  );
};
